import React from 'react';
import useAxios from 'axios-hooks'
import { Card, Col, Row, Table, Tabs} from 'antd';
import { MoneyCollectOutlined, DollarOutlined } from '@ant-design/icons';
import { FcTodoList } from "react-icons/fc";



const TableList = () => {
    const { TabPane } = Tabs;
    const columns2 = [
      { title: '순위', dataIndex: 'rank', key: '1' },
      { title: '순위2', dataIndex: 'rank2', key: '1' }
    ]

    const data2 = [
      {
          key: '1',
          rank: '1',
          rank2: '1'
      },
      {
        key: '2',
        rank: '2',
        rank2: '2'
      }
    ]
    const columns = [
        //  { title: '순위', width: 60, dataIndex: 'rank', key: '1' },
         { title: '기업', width: 215, dataIndex: 'name', key: '2' },

      ];

      // const [{ data, loading, error }] = useAxios(
      //   'http://localhost:8000/api/first_money/'
      // )

      const data = [
        {
            key: '1',
            // rank: '1',
            name: '한국해외인프라도시개발지원공사',

          },
          {
            key: '2',
            // rank: '2',
            name: '한국수자원공사',

          },
      ];

    return (
        <Row className="card_section">
            <Col xs={{span: 24}} sm={{ span: 14, offset: 5 }}>
                <Card 
                  title={
                    <span>
                        <div className='title_logo'><FcTodoList/></div> 
                        <div className='title_content'>전체</div>
                    </span>
                  } 
                  style={{ width: "100%" }}
                >
                <Tabs defaultActiveKey="1">
                  <TabPane
                    tab={
                      <span>
                        <MoneyCollectOutlined />
                        신입 초봉
                      </span>
                    }
                    key="1"
                  >
                    <Row>
                      <Col span = {2}>
                       {/* <Table 
                        columns={columns2} 
                        dataSource={data2} 
                        pagination={{hideOnSinglePage: true}} 
                        /> */}

                        <Table 
                        columns={columns} 
                        dataSource={data} 
                        scroll={{ x: 1200 }}
                        pagination={{hideOnSinglePage: true}} 
                        />
                      </Col>
                      <Col span = {22}>
                        {/* <Table 
                        columns={columns} 
                        dataSource={data} 
                        scroll={{ x: 1200 }}
                        pagination={{hideOnSinglePage: true}} 
                        /> */}
                      </Col>
                    </Row>

                  </TabPane>
                  <TabPane
                    tab={
                      <span>
                        <DollarOutlined />
                        평균 연봉
                      </span>
                    }
                    key="2"
                  >
                    Tab 2
                  </TabPane>
                </Tabs>    


                </Card>
            </Col>
        </Row>
    );
};

export default TableList;
